pragma solidity ^0.8.20;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/PausableUpgradeable.sol";

/**
 * @title TokenVaultV2
 * @dev A vault for storing ETH with pause functionality - Version 2
 * Used with Transparent Proxy pattern
 */
contract TokenVaultV2 is Initializable, OwnableUpgradeable, ReentrancyGuardUpgradeable, PausableUpgradeable {
    mapping(address => uint256) public balances;
    uint256 public totalDeposits;
    uint256 public withdrawalFee; // in basis points (100 = 1%)
    uint256 public collectedFees;

    event Deposited(address indexed user, uint256 amount);
    event Withdrawn(address indexed user, uint256 amount, uint256 fee);
    event FeeCollected(address indexed collector, uint256 amount);
    event WithdrawalFeeUpdated(uint256 oldFee, uint256 newFee);

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() {
        _disableInitializers();
    }

    function initialize(address initialOwner) public initializer {
        __Ownable_init(initialOwner);
        __ReentrancyGuard_init();
        __Pausable_init();
    }

    function initializeV2(uint256 _withdrawalFee) public reinitializer(2) {
        require(_withdrawalFee <= 1000, "Vault: fee too high"); // max 10%
        withdrawalFee = _withdrawalFee;
    }

    function deposit() external payable nonReentrant whenNotPaused {
        require(msg.value > 0, "Vault: deposit amount must be greater than zero");
        balances[msg.sender] += msg.value;
        totalDeposits += msg.value;
        emit Deposited(msg.sender, msg.value);
    }

    function withdraw(uint256 amount) external nonReentrant whenNotPaused {
        require(amount > 0, "Vault: withdraw amount must be greater than zero");
        require(balances[msg.sender] >= amount, "Vault: insufficient balance");

        uint256 fee = (amount * withdrawalFee) / 10000;
        uint256 amountAfterFee = amount - fee;

        balances[msg.sender] -= amount;
        totalDeposits -= amount;
        collectedFees += fee;

        (bool success, ) = msg.sender.call{value: amountAfterFee}("");
        require(success, "Vault: transfer failed");

        emit Withdrawn(msg.sender, amountAfterFee, fee);
    }

    function collectFees() external onlyOwner nonReentrant {
        uint256 fees = collectedFees;
        require(fees > 0, "Vault: no fees to collect");
        collectedFees = 0;

        (bool success, ) = owner().call{value: fees}("");
        require(success, "Vault: fee transfer failed");

        emit FeeCollected(owner(), fees);
    }

    function setWithdrawalFee(uint256 _withdrawalFee) external onlyOwner {
        require(_withdrawalFee <= 1000, "Vault: fee too high");
        uint256 oldFee = withdrawalFee;
        withdrawalFee = _withdrawalFee;
        emit WithdrawalFeeUpdated(oldFee, _withdrawalFee);
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

    function getBalance(address user) external view returns (uint256) {
        return balances[user];
    }

    function getTotalDeposits() external view returns (uint256) {
        return totalDeposits;
    }

    function getCollectedFees() external view returns (uint256) {
        return collectedFees;
    }
}

